import React from 'react';
import { Link } from 'react-router-dom';
import './header.css';
import axios from 'axios';
import {Nav, NavDropdown } from 'react-bootstrap';




function Header(){
    return (
        <div>
            <Nav bg="dark" variant="dark">
           
                 <Link  to='/login'>
                    <li> Logins </li>
                </Link>
                </Nav>
            </div>
    );
}

export default Header;
